import React from "react";
import { NavLink } from "react-router-dom";

import styled from "styled-components";


const Nav = () => {

const Nav =styled.nav`.navbar-lists {
    display: flex;
    gap: 4.8rem;
    align-items: center;

    .navbar-link {
      &:link,
      &:visited {
        display: inline-block;
        text-decoration: none;
        font-size: 1.8rem;
        font-weight: 500;
        text-transform: uppercase;
        color: ${({ theme }) => theme.colors.black};
        transition: color 0.3s linear;
      }

      &:hover,
      &:active {
        color: ${({ theme }) => theme.colors.helper};
      }
    }
  }
  .mobile-navbar-btn {
      display: none;
      background-color: transparent;
      cursor: pointer;
      border: none;
    }

    .mobile-nav-icon[name="close-outline"] {
      display: none;
    }

    .close-outline {
      display: none;
    }

    .cart-trolley--link {
      position: relative;

      .cart-trolley {
        position: relative;
        font-size: 3.2rem;
      }

      .cart-total--item {
        width: 2.4rem;
        height: 2.4rem;
        position: absolute;
        background-color: #000;
        color: #000;
        border-radius: 50%;
        display: grid;
        place-items: center;
        top: -20%;
        left: 70%;
        background-color: ${({ theme }) => theme.colors.helper};
      }
    }


  `;



    return (
        <div className="navbar">
            <ul className="navbar-list">
                <li>
                    <NavLink to="/" className="navbar-link home-link"> Home</NavLink>
                </li>
                <li>
                    <NavLink to="/about" className="navbar-link home-link">About</NavLink>
                </li>
                <li>
                    <NavLink to="/products" className="navbar-link home-link">Products</NavLink>
                </li>
                <li>
                    <NavLink to="/contact" className="navbar-link home-link">Contact</NavLink>
                </li>
                <li>
                    <NavLink to="/cart" className="navbar-link home-link">Cart</NavLink>
                </li>
            </ul>
        </div>

    );

}


export default Nav;
